Ext.data.JsonP['Appcelerator_Dashboard_FAQ']({"guide":"<?xml version=\"1.0\" encoding=\"UTF-8\" ?>\n<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\"\n        \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\n<head>\n    <title>Appcelerator Dashboard FAQ</title>\n\n    <meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\n    <meta content=\"Scroll EclipseHelp Exporter\" name=\"generator\">\n\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\" media=\"print\">\n</link></link></link></meta></meta></head>\n<body>\n    <div class=\"container\">\n        <div class=\"header\"/>\n\n        <div id=\"src-50725612\" class=\"content\">\n                        <h1>Appcelerator Dashboard FAQ</h1>\n    <p>This document provides questions and answers to common asked questions about Appcelerator Dashboard.    </p>\n    <p>    </p>\n<ul class=\"toc-indentation \"><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/Appcelerator_Dashboard_FAQ-section-src-50725612_safe-id-QXBwY2VsZXJhdG9yRGFzaGJvYXJkRkFRLUNyZWF0aW5nY3VzdG9tTW9iaWxlQmFja2VuZFNlcnZpY2VzKE1CUylvYmplY3Rz\">Creating custom Mobile Backend Services (MBS) objects</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/Appcelerator_Dashboard_FAQ-section-src-50725612_AppceleratorDashboardFAQ-CreatingAPIkeys\">Creating API keys</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/Appcelerator_Dashboard_FAQ-section-src-50725612_AppceleratorDashboardFAQ-Creatingenvironments\">Creating environments</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/Appcelerator_Dashboard_FAQ-section-src-50725612_AppceleratorDashboardFAQ-Authorizingabrowserordevice\">Authorizing a browser or device</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/Appcelerator_Dashboard_FAQ-section-src-50725612_AppceleratorDashboardFAQ-Keymetrics\">Key metrics</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/Appcelerator_Dashboard_FAQ-section-src-50725612_AppceleratorDashboardFAQ-Customdatarange\">Custom data range</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/Appcelerator_Dashboard_FAQ-section-src-50725612_AppceleratorDashboardFAQ-Exportingdata\">Exporting data</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/Appcelerator_Dashboard_FAQ-section-src-50725612_AppceleratorDashboardFAQ-Managingdatasource\">Managing datasource</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/Appcelerator_Dashboard_FAQ-section-src-50725612_AppceleratorDashboardFAQ-Commonsendingandschedulingpusherrors\">Common sending and scheduling push errors</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/Appcelerator_Dashboard_FAQ-section-src-50725612_AppceleratorDashboardFAQ-Configuringcloudservices\">Configuring cloud services</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/Appcelerator_Dashboard_FAQ-section-src-50725612_AppceleratorDashboardFAQ-Viewingcustomcloudservices\">Viewing custom cloud services</a>    </p>\n</li></ul>    <div class=\"section section-2 \" id=\"src-50725612_safe-id-QXBwY2VsZXJhdG9yRGFzaGJvYXJkRkFRLUNyZWF0aW5nY3VzdG9tTW9iaWxlQmFja2VuZFNlcnZpY2VzKE1CUylvYmplY3Rz\">\n        <h2 class=\"heading \"><span>Creating custom Mobile Backend Services (MBS) objects</span></h2>\n    <p>See <a class=\"document-link \" href=\"#!/guide/Custom_Objects_and_Fields\">Custom Objects and Fields</a> for more information.    </p>\n    </div>\n    <div class=\"section section-2 \" id=\"src-50725612_AppceleratorDashboardFAQ-CreatingAPIkeys\">\n        <h2 class=\"heading \"><span>Creating API keys</span></h2>\n    <p>To create API keys (development and production), see  see <a class=\"document-link \" href=\"#!/guide/API_Builder_Configuration-section-src-49153261_APIBuilderConfiguration-Introduction\">API Builder Configuration</a> for more information.    </p>\n    </div>\n    <div class=\"section section-2 \" id=\"src-50725612_AppceleratorDashboardFAQ-Creatingenvironments\">\n        <h2 class=\"heading \"><span>Creating environments</span></h2>\n    <p>To create an environment, see <a class=\"document-link \" href=\"#!/guide/API_Builder_Configuration-section-src-49153261_APIBuilderConfiguration-Introduction\">API Builder Configuration</a> for more information.    </p>\n    </div>\n    <div class=\"section section-2 \" id=\"src-50725612_AppceleratorDashboardFAQ-Authorizingabrowserordevice\">\n        <h2 class=\"heading \"><span>Authorizing a browser or device</span></h2>\n    <p>Refer to <a class=\"document-link \" href=\"#!/guide/Appcelerator_Dashboard_Getting_Started-section-src-50168366_AppceleratorDashboardGettingStarted-AuthorizingaBrowserorDevice\">Authorizing a browser or device</a> for more information.    </p>\n    </div>\n    <div class=\"section section-2 \" id=\"src-50725612_AppceleratorDashboardFAQ-Keymetrics\">\n        <h2 class=\"heading \"><span>Key metrics</span></h2>\n    <p>What do all the metrics mean on the Dashboard?    </p>\n    <p>See <a class=\"document-link \" href=\"#!/guide/Appcelerator_Dashboard_Getting_Started-section-src-50168366_AppceleratorDashboardGettingStarted-KeyMetrics\">Key metrics</a> for more information.    </p>\n    </div>\n    <div class=\"section section-2 \" id=\"src-50725612_AppceleratorDashboardFAQ-Customdatarange\">\n        <h2 class=\"heading \"><span>Custom data range</span></h2>\n    <p>To set a custom data range, please review <a class=\"document-link \" href=\"#!/guide/Appcelerator_Dashboard_Getting_Started-section-src-50168366_safe-id-QXBwY2VsZXJhdG9yRGFzaGJvYXJkR2V0dGluZ1N0YXJ0ZWQtQ3VzdG9tRGF0ZS9UaW1lUmFuZ2VGaWx0ZXI\">Custom Date/Time Range Filter</a> for more details.    </p>\n    </div>\n    <div class=\"section section-2 \" id=\"src-50725612_AppceleratorDashboardFAQ-Exportingdata\">\n        <h2 class=\"heading \"><span>Exporting data</span></h2>\n    <p>To export analytic data from Dashboard, see <a class=\"document-link \" href=\"#!/guide/Appcelerator_Dashboard_Getting_Started-section-src-50168366_AppceleratorDashboardGettingStarted-ExportData\">Export Data</a> for more details.    </p>\n    </div>\n    <div class=\"section section-2 \" id=\"src-50725612_AppceleratorDashboardFAQ-Managingdatasource\">\n        <h2 class=\"heading \"><span>Managing datasource</span></h2>\n    <p>Read <a class=\"document-link \" href=\"#!/guide/Managing_Mobile_Backend_Services_Datasources\">Managing Mobile Backend Services Datasources</a> for more information on how to manage datasource within Dashboard.    </p>\n    </div>\n    <div class=\"section section-2 \" id=\"src-50725612_AppceleratorDashboardFAQ-Commonsendingandschedulingpusherrors\">\n        <h2 class=\"heading \"><span>Common sending and scheduling push errors</span></h2>\n    <p>See <a class=\"document-link \" href=\"#!/guide/Sending_and_Scheduling_Push_Notifications-section-src-43298780_SendingandSchedulingPushNotifications-Troubleshootingcommonerrors\">Troubleshooting common errors</a> for more information about troubleshooting sending and scheduling push errors    </p>\n    </div>\n    <div class=\"section section-2 \" id=\"src-50725612_AppceleratorDashboardFAQ-Configuringcloudservices\">\n        <h2 class=\"heading \"><span>Configuring cloud services</span></h2>\n    <p>To configure cloud services within Dashboard, please review <a class=\"document-link \" href=\"#!/guide/Configuring_Cloud_Services\">Configuring Cloud Services</a> for more details.    </p>\n    </div>\n    <div class=\"section section-2 \" id=\"src-50725612_AppceleratorDashboardFAQ-Viewingcustomcloudservices\">\n        <h2 class=\"heading \"><span>Viewing custom cloud services</span></h2>\n    <p>If you have configured custom cloud services for your app, you can view information about the API Builder application in Dashboard. Please review <a class=\"document-link \" href=\"#!/guide/Viewing_Custom_Cloud_Services\">Viewing Custom Cloud Services</a> for more information.    </p>\n    </div>\n        </div><a id=\"editButton\" href=\"https://wiki.appcelerator.org/pages/editpage.action?pageId=50725612\"><span>Edit</span></a>\n    \n        \n    </div>\n</body>\n</html>\n","title":"Appcelerator Dashboard FAQ"});